// ---- Header ----
function Header({ location, setLocation }) {
  const navigate = useNavigate();
  const [query, setQuery] = useState("");
  const [showLocation, setShowLocation] = useState(false);

  const handleSearch = (e) => {
    e.preventDefault();
    if (query.trim()) {
      navigate(`/movies?search=${encodeURIComponent(query.trim())}`);
    }
  };

  const handleThemeToggle = () => {
    document.body.dataset.theme =
      document.body.dataset.theme === "dark" ? "" : "dark";
  };

  const handleLocationSelect = (city) => {
    setLocation(city);
    setShowLocation(false);
  };

  return (
    <header className="header">
      <div className="logo">
        Show<span style={{ color: "red" }}>time</span>hub
      </div>
      <form onSubmit={handleSearch} style={{ display: "flex", flex: 1 }}>
        <input
          className="search"
          type="text"
          value={query}
          onChange={e => setQuery(e.target.value)}
          placeholder="Search for Movies, Events, Plays, Sports and Activities"
          aria-label="Search"
        />
        <button
          type="submit"
          style={{
            background: "var(--accent)",
            color: "#fff",
            border: "none",
            borderRadius: "6px",
            marginLeft: "8px",
            padding: "0 18px",
            fontWeight: "700",
            cursor: "pointer"
          }}
          aria-label="Submit Search"
        >
          Search
        </button>
      </form>
      <div className="user-actions" style={{ position: "relative" }}>
        <Navbar />
        <button
          style={{
            background: "none",
            border: "none",
            color: "var(--text)",
            fontWeight: 600,
            cursor: "pointer",
            padding: "4px 8px"
          }}
          onClick={() => setShowLocation(v => !v)}
          aria-haspopup="listbox"
          aria-expanded={showLocation}
          aria-label="Select location"
        >
          {location || "Select City"} ▼
        </button>
        {showLocation && (
          <ul
            tabIndex={-1}
            className="location-dropdown"
            style={{
              position: "absolute",
              top: "38px",
              right: "50px",
              background: "var(--card)",
              border: "1px solid var(--border)",
              borderRadius: "10px",
              boxShadow: "0 4px 16px #0002",
              zIndex: 200,
              minWidth: "140px",
              padding: "8px 0"
            }}
          >
            {CITIES.map((city) => (
              <li
                key={city}
                onClick={() => handleLocationSelect(city)}
                style={{
                  padding: "10px 26px 10px 18px",
                  cursor: "pointer",
                  color: city === location ? "var(--accent)" : "var(--text)",
                  background: city === location ? "#ffdede" : "transparent",
                  fontWeight: 500
                }}
                tabIndex={0}
                role="option"
                aria-selected={city === location}
                onKeyDown={e => {
                  if (e.key === 'Enter' || e.key === ' ') handleLocationSelect(city);
                }}
              >
                {city}
              </li>
            ))}
          </ul>
        )}
        <button
          className="theme-toggle-btn"
          onClick={handleThemeToggle}
          aria-label="Toggle dark mode"
          title="Toggle dark mode"
        >
          🌓
        </button>
      </div>
    </header>
  );
}

