// ---- Poster Slider ----
function PosterSlider({ posters }) {
  const [index, setIndex] = useState(0);
  const length = posters.length;
  if (!posters || !length) return null;

  const goPrev = () => setIndex((prev) => (prev === 0 ? length - 1 : prev - 1));
  const goNext = () => setIndex((prev) => (prev === length - 1 ? 0 : prev + 1));

  return (
    <div
      style={{
        width: "100%",
        maxWidth: 860,
        margin: "30px auto 20px auto",
        position: "relative",
        textAlign: "center"
      }}
    >
      <img
        src={posters[index]}
        alt={`Poster ${index + 1}`}
        style={{
          width: "100%",
          height: "340px",
          maxHeight: "40vw",
          objectFit: "cover",
          borderRadius: "18px",
          boxShadow: "0 6px 32px #0002",
          transition: "all .4s cubic-bezier(.4,0,.2,1)"
        }}
      />
      {/* Slider Controls */}
      <button
        onClick={goPrev}
        style={{
          position: "absolute",
          left: 5,
          top: "50%",
          transform: "translateY(-50%)",
          background: "rgba(0,0,0,0.5)",
          color: "#fff",
          border: "none",
          borderRadius: "50%",
          width: 44,
          height: 44,
          fontSize: 22,
          cursor: "pointer"
        }}
        aria-label="Previous"
      >‹</button>
      <button
        onClick={goNext}
        style={{
          position: "absolute",
          right: 5,
          top: "50%",
          transform: "translateY(-50%)",
          background: "rgba(0,0,0,0.5)",
          color: "#fff",
          border: "none",
          borderRadius: "50%",
          width: 44,
          height: 44,
          fontSize: 22,
          cursor: "pointer"
        }}
        aria-label="Next"
      >›</button>
      {/* Bullets */}
      <div style={{ marginTop: 18, textAlign: "center" }}>
        {posters.map((_, i) => (
          <span
            key={i}
            onClick={() => setIndex(i)}
            style={{
              display: "inline-block",
              width: 11,
              height: 11,
              borderRadius: "50%",
              margin: "0 6px",
              background: i === index ? "var(--accent)" : "#dadada",
              cursor: "pointer",
              border: i === index ? "2px solid var(--accent)" : "1px solid #ccc"
            }}
            aria-label={`Go to slide ${i + 1}`}
          />
        ))}
      </div>
    </div>
  );
}

// ---- Horizontal Card Slider ----
function CardSlider({ title, items, renderItem, maxItems = 5 }) {
  const [startIndex, setStartIndex] = useState(0);
  const visibleItems = Math.min(maxItems, items.length);
  const maxStartIndex = Math.max(0, items.length - visibleItems);

  const goPrev = () => {
    setStartIndex(prev => Math.max(0, prev - 1));
  };

  const goNext = () => {
    setStartIndex(prev => Math.min(maxStartIndex, prev + 1));
  };

  if (!items || items.length === 0) return null;

  return (
    <div style={{ marginBottom: '40px' }}>
      <h2 style={{ marginBottom: '20px', textAlign: 'center', fontSize: '24px', fontWeight: '600' }}>
        {title}
      </h2>
      <div style={{ position: 'relative', overflow: 'hidden' }}>
        <div 
          style={{ 
            display: 'flex', 
            gap: '12px', 
            transform: `translateX(-${startIndex * (100 / visibleItems)}%)`,
            transition: 'transform 0.3s ease',
            width: `${(items.length * 100) / visibleItems}%`
          }}
        >
          {items.map((item, index) => (
            <div key={item.id} style={{ flex: `0 0 ${100 / visibleItems}%` }}>
              {renderItem(item)}
            </div>
          ))}
        </div>
        
        {/* Navigation Buttons */}
        {items.length > visibleItems && (
          <>
            <button
              onClick={goPrev}
              disabled={startIndex === 0}
              style={{
                position: 'absolute',
                left: '-20px',
                top: '50%',
                transform: 'translateY(-50%)',
                background: 'var(--accent)',
                color: 'white',
                border: 'none',
                borderRadius: '50%',
                width: '40px',
                height: '40px',
                fontSize: '18px',
                cursor: startIndex === 0 ? 'not-allowed' : 'pointer',
                opacity: startIndex === 0 ? 0.5 : 1,
                zIndex: 10
              }}
              aria-label="Previous"
            >
              ‹
            </button>
            <button
              onClick={goNext}
              disabled={startIndex >= maxStartIndex}
              style={{
                position: 'absolute',
                right: '-20px',
                top: '50%',
                transform: 'translateY(-50%)',
                background: 'var(--accent)',
                color: 'white',
                border: 'none',
                borderRadius: '50%',
                width: '40px',
                height: '40px',
                fontSize: '18px',
                cursor: startIndex >= maxStartIndex ? 'not-allowed' : 'pointer',
                opacity: startIndex >= maxStartIndex ? 0.5 : 1,
                zIndex: 10
              }}
              aria-label="Next"
            >
              ›
            </button>
          </>
        )}
      </div>
    </div>
  );
}

// ---- Card & List ----
function RecommendedMovies() {
  const location = useLocation();
  const params = new URLSearchParams(location.search);
  const search = params.get("search")?.toLowerCase() || "";

  const filtered = search
    ? movies.filter(
        m =>
          m.title.toLowerCase().includes(search) ||
          m.genre.toLowerCase().includes(search)
      )
    : movies;

  return (
    <section className="recommended">
      <h2>Recommended Movies</h2>
      <div className="movies-row">
        {filtered.length ? (
          filtered.slice(0, 10).map((movie) => (
            <MovieCard movie={movie} key={movie.id} />
          ))
        ) : (
          <div style={{ padding: "40px", color: "var(--accent)" }}>
            No movies found for "{search}"
          </div>
        )}
      </div>
    </section>
  );
}

