function MovieDetail() {
  const { id } = useParams();
  const movie = movies.find((m) => String(m.id) === id);
  const navigate = useNavigate();
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [checkingAuth, setCheckingAuth] = useState(true);

  // Check authentication status
  React.useEffect(() => {
    const token = localStorage.getItem('token');
    const username = localStorage.getItem('username');
    if (token && username) {
      setIsAuthenticated(true);
    }
    setCheckingAuth(false);
  }, []);

  const handleBookTickets = () => {
    if (isAuthenticated) {
      navigate(`/book/${movie.id}`);
    } else {
      // Store the intended booking URL and redirect to sign in
      localStorage.setItem('redirectAfterLogin', `/book/${movie.id}`);
      navigate('/signin');
    }
  };

  if (!movie) return <div>Movie not found</div>;

  if (checkingAuth) {
    return (
      <div style={{ padding: 20, textAlign: 'center' }}>
        <div>Loading...</div>
      </div>
    );
  }

  return (
    <div className="movie-detail" style={{ padding: 20 }}>
      <img src={movie.poster} alt={movie.title} style={{ borderRadius: 10, width: 300 }} />
      <h1>{movie.title}</h1>
      <p>Genre: {movie.genre}</p>
      <p>Rating: {movie.rating} ({movie.votes})</p>
      <button 
        onClick={handleBookTickets}
        style={{
          background: isAuthenticated ? 'var(--accent)' : '#ff6b6b',
          color: 'white',
          border: 'none',
          borderRadius: '8px',
          padding: '12px 24px',
          fontSize: '16px',
          fontWeight: '600',
          cursor: 'pointer',
          marginTop: '16px'
        }}
      >
        {isAuthenticated ? 'Book tickets' : 'Sign in to Book tickets'}
      </button>
      {!isAuthenticated && (
        <p style={{ color: '#666', fontSize: '14px', marginTop: '8px' }}>
          You need to be signed in to book tickets
        </p>
      )}
    </div>
  );
}

